@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Parameter a owl:Class .

atm:k a atm:Parameter .
atm:m a atm:Parameter .
atm:n a atm:Parameter .

atm:initializeParameters a owl:ObjectProperty ;
    rdfs:domain atm:Parameter ;
    rdfs:range atm:Parameter .

atm:setParameters a owl:ObjectProperty ;
    rdfs:domain atm:Parameter ;
    rdfs:range atm:Parameter .

atm:k atm:initializeParameters atm:t .
atm:m atm:initializeParameters atm:t .
atm:n atm:initializeParameters atm:t .

atm:k atm:setParameters atm:t .
atm:m atm:setParameters atm:t .
atm:n atm:setParameters atm:t .
